    uint8 constant public decimals = 18;
    string constant public name = "0x Protocol Token";
    string constant public symbol = "ZRX";
    // solhint-enableconst-name-snakecase

    function ZRXToken2()  public
    {
        balances[msg.sender] = 10**27;
    }
}

